        for id in ids:
            found = False
            for group in groups:
                if salaries[group[0]][id] < mx:
                    group.append(id)
                    found = True
                    break
            if not found:
                groups.append([id])
        for group in groups:
            parents.append([split(group), cur])
        return cur
    for i in range(n):
        res.append(salaries[i][i])
    chief = split([i for i in range(n)])
    return (len(res), res, chief, parents)

